import React from 'react';
import './navbar.css';
import {AppBar, Toolbar, Typography,Tabs,Tab} from '@mui/material';
export default function NavBar(){
    return(
        <React.Fragment>
            <AppBar>
                <Toolbar>
                <Tabs  textcolor="white">
                    <Tab label="Home"/>
                    <Tab label="About"/>
                    <Tab label="Contact"/>
                </Tabs>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    );
}
